import React from "react";
import "./App.css";

import Latest from "./components/Latest/Latest";
import Hub from "./components/Hub/Hub";

interface Image {
    src: string;
    title: string;
}

const App = () => {
    const images: Image[] = [
        { src: "image1.jpg", title: "Image 1" },
        { src: "image2.jpg", title: "Image 2" },
        // ...
    ];
    return (
        <div className="App">
            <Hub images={images}></Hub>
        </div>
    );
};

export default App;
